import React from 'react';
import { Link, withRouter } from 'react-router-dom';
import { isAuthenciate, Signout } from '../auth/index';

// const isActive = (history, path) => {
//     if(history.location.pathname === path) return { color: "#1C1D21" };
//     else return { color: "#ffffff" };
// };

const Menu = (title) => (
    <div>
        <nav className="navbar navbar-expand-sm bg-light fixed-top" style={myNavbar}>
            <div className="container">
                <div className="navbar-brand">
                    <img width="200" height="100" src="https://cdn2.f-cdn.com/contestentries/1295465/14376482/5ac3d4cdc34ab_thumb900.jpg" />
                </div>
                <ul className="nav justify-content-center">
                    <h4>{title}</h4>
                </ul>   
                <ul className="nav justify-content-end">
                    <li className="nav-item">
                        <Link className="nav-link"><span><i className="fa fa-users" style={{ fontSize: "30px"}}></i></span></Link>                   
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link"><span><i className="fa fa-user-o" style={{ fontSize: "30px"}}></i></span></Link>                   
                    </li>
                    <li className="nav-item">
                        <Link className="nav-link"><span><i className="fa fa-sign-out" style={{ fontSize: "30px"}}></i></span></Link>                   
                    </li>
                </ul>
            </div>
        </nav>
    </div>
);

const myNavbar = {
    height: "90px",
    overflow: "hidden"
};

export default withRouter(Menu);
